import React, { useEffect, useState } from 'react';
import { TypeAnimation } from 'react-type-animation';
import './App.css';

function App() {
  const [value, setValue] = useState<string>('Waiting on value');

  async function test() {
    return "TESTING";
  }

  useEffect(() => {
    fetch('http://localhost:8080/college-essay')
        .then((response) => response.json())
        .then((data) => setValue(data.body));
  }, []);

  return (

    <div className="App">
        <input type="textarea" 
          name="textValue"
        />
        <div className="response">{value}</div>
        <TypeAnimation
          sequence={[
            // () => {
            //   return new Promise((resolve) => setTimeout(resolve, 3000));
            // },
            () => {
              return fetch('http://localhost:8080/college-essay')
              .then((response) => response.json()).then(data => data.body)
            },
            // value,
          ]}
          speed={70}
          wrapper="div"
          repeat={Infinity}
        />

    </div>
  );
}

export default App;
